import React from 'react';
import { useLocation } from 'react-router-dom';
import '../styles/SubscriptionForm.css';

function SubscriptionForm() {
    const location = useLocation();
    const subscription = location.state?.subscription;

    const handleSubmit = (e) => {
        e.preventDefault();
        // Логика оформления подписки
        alert(`Подписка "${subscription.name}" успешно оформлена!`);
    };

    return (
        <div className="subscription-form-container">
            <h1>Оформление подписки</h1>
            <p>Вы выбрали подписку: {subscription.name}</p>
            <form onSubmit={handleSubmit}>
                <label>
                    Номер карты:
                    <input type="text" name="cardNumber" placeholder="1234 5678 9012 3456" required />
                </label>
                <label>
                    Дата истечения:
                    <input type="text" name="expiryDate" placeholder="MM/YY" required />
                </label>
                <label>
                    CVC:
                    <input type="text" name="cvc" placeholder="123" required />
                </label>
                <button type="submit">Оплатить</button>
            </form>
        </div>
    );
}

export default SubscriptionForm;
